function App() {
  const fname = 'Devohn';
  const lname = 'Hall';
  const hobbies = ['Skiing', 'Snowboarding', 'Hiking'];

  return (
    <div className="home">
      <h1>Welcome to my Home Page</h1>
      <p>
        My name is {fname} {lname}
      </p>

      <div className="hobbies">
        <h2>Hobbies</h2>
        <ul>
          {hobbies.map((hobby, index) => {
            return <li key={index}>{hobby}</li>;
          })}
        </ul>
      </div>
    </div>
  );
}

export default App;
